Information
------------------------------

Megafactories Swiss Army Knife
Take a look at the most amazing factories in the world. Lift the lid on how millions of your everyday products and iconic designs begin life on the assembly line in a brand new series of Megafactories
The Swiss Army Knife Used by everyone from boy scouts to presidents, the Swiss Army Knife may be the most ingenious multipurpose tool ever invented - with an equally ingenious process for its production. The Swiss Army knife factory in Ibach, Switzerland, where two shifts of workers turn raw steel into 17 million intricate parts every year.

